import React from 'react'
import './Notifications.css'

export  function Notifications(){
    return(
        <div className='Notifications'>
            <p>Here is the list of notifications</p>
            <button
            aria-label='Close'
            type='button'
            style={{
                position: 'absolute',
                right: '16px',
                top: '16px',
                cursor: 'pointer',
                maxHeight: '17px',
                background: 'transparent',
                border: 'none'
              }}

            >
                <img
              />
            </button>
        </div>

    );
}
